import NavAppDownload from "./NavAppDownload";
import NavFavorite from "./NavFavorite";
import NavLogin from "./NavLogin";
import NavMyMarket from "./NavMyMarket";
import "./Nav.css";

const NavContainer = () => {
  return (
    <div className="navBar">
      <div>
        <NavAppDownload />
        <NavFavorite />
      </div>
      <div>
        <NavLogin />
        <NavMyMarket />
      </div>
    </div>
  );
};

export default NavContainer;
